import React from "react"

class Tasks extends React.Component {

    render() {
        return(
            <div className="tasks">
                <h5>Tasks</h5>
                <div>
                    <div className="task">
                        <div className="label">Misc</div>
                        <div className="text">Tidy house</div>
                    </div>
                </div>
            </div>

        )
    }
}

export default Tasks
